import React, {Component} from 'react'
import { green } from 'ansi-colors'
import './App.css'
import Navbar from './Nav.js'
import Web3 from 'web2'

class App extends Component{
    async Web3() {
        if(window.ethereuem){
            window.web3 =new Web3.enable()
        }
    }
    constructor(props){
        super(props)
        this.state = {
            account: '0x2'
        }
    }
    render(){
        return(
            <div>
                <Navbar account={this.state.account}/>
                <div className="text-center" >
                    <h></h>
                </div>
            </div>
        )
    }
}

export default App;
